  false,\n\t\"url\": null,\n\t\"notes\": \"The Lower Souris Migratory Waterfowl Refuge
  (now known as the J. Clark Salyer National Wildlife Refuge) is located just south
  of the Canadian border in North Dakota. The refuge was established and constructed
  by the CCC in 1935 to restore waterfowl habitat. This report gives an overview of
  events taking place on the refuge in August of 1936. A great deal of time was taken
  in August by Public Relations work. Due to the abundance of hay on the refuge, hundreds
  of farmers came to see about the possibility of securing some. The drought continued,
  causing cracks in the soil up to four inches in width. Major projects on the refuge
  included dam building and fencing. Like in July, duck and other waterfowl rescue
  operations took place as the ponds, sloughs and streams continued to go dry. Other
  areas of focus included erosion control and seed collection. .The report concludes
  with a photographs section.\",\n\t\"owner_org\": \"4d7ad1cd-3641-420b-8116-e4082f49cd44\",\n\t\"extras\":
